    xAxis: {
      type: 'category',
      axisTick: {
        show: false,
      },
      axisLabel: {
        show: false,
      },
    },
    yAxis: {
      show: false,
      type: 'value',
    },
    series: [
      {
        type: 'bar',
        label: {
          show: true,
